import React from 'react'

class SearchResults extends React.Component{
    render(){
        return(
            <div className='SearchResults'>
                <h1>{this.props.link}</h1>
                <h1>{this.props.title}</h1>
                <h1>{this.props.description}</h1>
            </div>
        )
    }
}

export default SearchResults
